import Layout from '../components/Layout'
import Head from 'next/head'

export default function About() {
    return (      
      <div>
           <Head>
            <title>Projects</title>
        </Head>
        <Layout />
        <p>This is the about page</p>
        <p>This is the about page</p>
        <p>This is the about page</p>
        <p>This is the about page</p>
        <p>This is the about page</p>
        <p>This is the about page</p>
        <div className="svg-wrapper">
  <svg height="166" width="166" xmlns="http://www.w3.org/2000/svg">
    <circle cx="83" cy="83" r="81" className="shape" height="166" width="166"></circle>
    <div className="text">kW</div>
  </svg>

</div>

        <style jsx>{`

        .svg-wrapper {
          position: relative;
          top: 50%;
          transform: translateY(-50%);
            margin: 0 auto;
          width: 164px;  
        }
        .shape {
          stroke-dasharray: 0 540;
          stroke-dashoffset: -474;
          stroke-width: 1px;
          stroke: #19f6e8;
          border-radius: 100%;
          transition: stroke-width 1s, stroke-dashoffset 1s, stroke-dasharray 1s;
        }
        .text {
          font-family: 'Roboto Condensed';
          font-size: 22px;
          line-height: 164px;
          letter-spacing: 8px;
          height:164px;
          color: #fff;
          top: 0;
          position: absolute;
          left:0;
          width:164px;
          text-align: center;
        }
        .svg-wrapper:hover .shape {
          stroke-width: 2px;
          stroke-dashoffset: 0;
          stroke-dasharray: 760;
          border-radius: 100%;
        }
          
        `} </style>
      </div>
    );
  }
